As I prepare to “Everest”
on skis, I’m thinking back to spring 2019 when I was on climbing Chomolungma/Everest with @lydiabradey, @carla.perez.ec and @rob.lea! Did you know Lydia is the first woman to climb Everest without oxygen and Carla is the first South American woman to summit without oxygen? I was honored to be surrounded by my heroes, and I’ll be thinking of them and their strength when I do my 24 hour uphill ski challenge starting tomorrow night at @brightonresort. Who else has big challenges planned for March? 
